import React, { Component } from "react";

class Like extends Component {
  getLikeUnlike = () => {
    let classes = "fa fa-heart-o";
    classes = this.props.likeCount % 2 === 0 ? "fa fa-heart-o" : "fa fa-heart";
    return classes;
  };
  state = {};
  render() {
    return (
      <i
        onClick={this.props.onLike}
        className={this.getLikeUnlike()}
        aria-hidden='true'
      ></i>
    );
  }
}

export default Like;
